sourcesContent:
import { Router } from "express";
import { register, updateCompany, getCompany, getAllCompanies } from "../controllers/companyController";
import { verifyToken, requireSuperAdmin } from "../controllers/authController";
const router = Router();

//ruta de creacion de cuenta
router.post("/create", register);
router.put("/update/:id", updateCompany);

router.get(
  "/get/:id",
  verifyToken,
  getCompany
);

router.get(
  "/getAll",
  verifyToken,
  requireSuperAdmin,
  getAllCompanies
);

export default router;

